function generate_name(model, existing_names,startkey="", N=3, maxlength=20){
  var initkey = " ".repeat(N-startkey.length) + startkey;
  var iteration = 0;
  const max_iterations=100000;

  while(true){
    var nafn = initkey;
    var key = initkey;
    for(var i=0; i<maxlength; i++){
      var probability = Math.random();
      for(var letter in model[key]) {
        probability -= model[key][letter];
        if(probability < 0){
          break;
        }
      }
      nafn = nafn + letter;
      key = nafn.slice(nafn.length-N,nafn.length);
      if(letter == " "){
        nafn = nafn.trim();
        break;
      }
      if(i === maxlength-2){
        nafn=nafn.trim();
        break;
      }
    }
    
    if(includes(existing_names, nafn) === false){
      return nafn;
    }
      
    iteration += 1;
    if(iteration>max_iterations){
      return "Ekkert nafn fannst";
    }
  }
}


function includes(arr,obj) {
    return (arr.indexOf(obj) != -1);
}


function generate_karlanafn() {
  var nyttnafn = generate_name(karla_model, karlanofn,startkey="", N=3, maxlength=20);
  karlanofn.push(nyttnafn);
  document.getElementById("karlmanns_takki").innerHTML = nyttnafn;
}

